import { jsPDF } from 'jspdf';

import { Handler } from '@netlify/functions';

export type GenerateCardPdfData = {
    title: Title;
};

type Title = BoundingBox & { text: string };

type BoundingBox = {
    x: number;
    y: number;
    width: number;
    height: number;
};

const backgroundImageBase64 =
    'data:image/png;base64,';

const norseFont =
    '';

export const handler: Handler = async (event) => {
    if (!event.body) {
        return {
            statusCode: 400,
            body: JSON.stringify({
                message: 'No body provided',
            }),
        };
    }

    const doc = new jsPDF({
        orientation: 'landscape',
        unit: 'mm',
        format: 'a4',
        encryption: { userPermissions: ['print'] },
    });

    doc.addFileToVFS('Norse.ttf', norseFont);
    doc.addFont('Norse.ttf', 'Norse', 'Normal');

    const cardWidth = 64;
    const cardHeight = 89;
    const marginX = 10; // Horizontal margin
    const marginY = 10; // Vertical margin

    const title = JSON.parse(event.body).title;

    for (let i = 0; i < 1; i++) {
        generateFront({ pageParams: { doc, i, cardWidth, cardHeight, marginX, marginY }, title });
        generateBack({ pageParams: { doc, i, cardWidth, cardHeight, marginX, marginY } });
    }

    // Generate PDF data
    const pdfData = doc.output('arraybuffer'); // You can use other output formats as well

    // Return the PDF data
    return {
        statusCode: 200,
        headers: {
            'Content-Type': 'application/pdf',
            'Content-Disposition': `attachment; filename="${title}.pdf"`,
        },
        body: Buffer.from(pdfData).toString('base64'),
        isBase64Encoded: true,
    };
};

type GenerateFrontParams = {
    pageParams: PageParams;
    title: Title;
};

function generateFront({ pageParams, title }: GenerateFrontParams) {
    const { doc, i, cardWidth, cardHeight, marginX, marginY } = pageParams;

    const cardX = marginX + i * (cardWidth + marginX);

    doc.addImage(backgroundImageBase64, 'JPEG', cardX, marginY, cardWidth, cardHeight);

    const textX = title.x + cardX;
    const textY = title.y + marginY; // Adjust as needed

    doc.setFont('Norse', 'Normal');
    doc.setFontSize(12);

    doc.text(title.text, textX, textY);

    doc.setFont('helvetica');
    doc.setFontSize(16);

    doc.text('Testing!!!!', textX, textY + 30, { align: 'center' });
}

type GenerateBackParams = {
    pageParams: PageParams;
};

type PageParams = {
    doc: jsPDF;
    i: number;
    cardWidth: number;
    cardHeight: number;
    marginX: number;
    marginY: number;
};

function generateBack({ pageParams }: GenerateBackParams) {
    const { doc, i, cardWidth, cardHeight, marginX, marginY } = pageParams;
    doc.addImage(backgroundImageBase64, 'JPEG', marginX + cardWidth, marginY, cardWidth, cardHeight);
}
